(let [other-counts (->> (mc/find-maps @db "pubs" {:source {$nin news-users}
                                                  :ts {$gt (t/date-time 2015 4 3)
                              						   $lt (t/date-time 2015 5 3)}})
                      (map (fn [{:keys [ts]}] (t/hour ts)))
                      frequencies
                      (sort-by first <))
      dat {:hours (map first other-counts)
           :counts (map (comp float #(/ % 30)) (map second other-counts))}]
  (gg4clj/view
    [[:<- :d (gg4clj/data-frame dat)]
     (gg4clj/r+
       [:ggplot :d [:aes :hours :counts]]
       [:geom_line {:stat "identity"}]
       [:geom_point]
       [:xlab "Hour"]
       [:ylab "Counts"]
       [:theme_bw]
       [:ggtitle "Publication time-of-day distribution"])]
    {:width 6
     :height 6}))
